import { List, message, Avatar, Spin } from 'antd';
import React from 'react'



class AntdComment extends React.Component {
    render() {
        const data = this.props.comments
        // console.log(data, 'helloworld')
        return (

            <List
                itemLayout="horizontal"
                dataSource={data}
                renderItem={item => (
                    <List.Item>
                        <List.Item.Meta
                            avatar={<Avatar src="https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png" />}
                            title={<a href="https://ant.design">{item.id}</a>}
                            description={item.review}
                            style={{ backgroundColor: 'white', height: '50px' }}
                        />
                        <div style={{ backgroundColor: 'white', height: '50px', width: '60px' }} >{item.score}</div>
                        <div style={{ backgroundColor: 'red', height: '50px', width: '60px' }}></div>
                    </List.Item>
                )}
            />
        );
    }
}


export default AntdComment
